import fetch from "node-fetch";
import { wizCloudAuth } from "./wizCloudAuth";

function getHashavshevetFormData(type) {
  const p = new Promise((resolve, reject) => {
    wizCloudAuth()
      .then(
        (token) => {
          const wizAuthToken = token;
          const url = `https://lb1.wizcloud.co.il/ExportDataApi/exportData`;

          const params = getParams(type);
          const options = {
            body: params,
            headers: {
              Authorization: `Bearer ${wizAuthToken}`,
            },
            method: "POST",
          };
          fetch(url, options)
            .then((data) => resolve(data))
            .catch((error) =>
              reject({ reason: "Failed to reach WizCloud API", err: error })
            );
        },
        (error) => {
          console.log("ERR12", error);
          throw new Error("auth error");
        }
      )
      .catch((e) => {
        console.log("ERR12", e);
        throw new Error("auth error");
      });
  });

  return p;
}

function getParams(type) {
  if (type == "transactions") {
    return transactionsFormParams;
  } else if (type == "titles") {
    return titlesFormParams;
  } else if (type == "batches") {
    return batchesFormParams;
  } else if (type == "accounts") {
    return accountsFormParams;
  }
}

